CREATE TABLE METER(MeterName text, MeterID text, Type text, Unit text, PRIMARY KEY(MeterName));
CREATE TABLE COST(MeterName text, StartDate date, EndDate date, Amount float(2), PRIMARY KEY(MeterName, StartDate, EndDate), FOREIGN KEY (MeterName) REFERENCES METER(MeterName));
CREATE TABLE ENERGY(MeterName text, StartDate date, EndDate date, Amount integer, PRIMARY KEY(MeterName, StartDate, EndDate), FOREIGN KEY (MeterName) REFERENCES METER(MeterName));
CREATE VIEW ENERGY_COST AS SELECT ENERGY.MeterName, ENERGY.StartDate, ENERGY.EndDate, ENERGY.Amount AS EnergyAmount, COST.Amount AS CostAmount FROM ENERGY INNER JOIN COST ON ENERGY.MeterName = COST.MeterName AND ENERGY.StartDate=COST.StartDate AND ENERGY.EndDate = COST.EndDate;